import axios from 'axios';
import React, { useState, useEffect } from 'react'
import AdminNavbar from '../components/admin/Admin-Navbar.js';


import './css/cars.css'

function LiveRented () {
  const [cars, setCars] = useState([])
  const[start, setStart] = useState();
  const[end, setEnd] = useState();

  const isAdmin = sessionStorage.getItem('admin');
  const rentDateObj = new Date(start);
  const returnDateObj = new Date(end);
  const timeDiff = returnDateObj.getTime() - rentDateObj.getTime();
  const daysDiff = timeDiff / (1000 * 3600 * 24); // number of milliseconds in a day
  useEffect(() => {
    if(!isAdmin){
      alert("Unauthorized User");
      window.location.href = '/login';
    }
    axios
      .get('http://localhost:8000/api/live')  //data fetch from rent 
      .then(response => {
        setCars(response.data)
        console.log(response.data)
        alert(response.data.rent_date)
        setStart(response.data.rent_date);
        setEnd(response.data.return_date);
      })
      .catch(error => {
        console.log(error)
      })
  }, [])


  return (

    <div className='main-cars'>
     <AdminNavbar />
         <h1 style={{ textAlign: 'center', margin:"10px" }}>Booked Cars</h1>
      <div className='product-list'>

        {cars.map(car => (
          <div className='product' key={car.id}>
            <h3>
              {car.brand} {car.model}
            </h3>
            <img
              id='img'
              src={`http://localhost:8000/storage/${car.image}`}
              alt={car.name}
            />
            <p>{car.fuel}</p>
            <p>{car.price} Rs Per day</p>
            <p>Rented By {car.user_name}</p>
            <p>Rented For {car.rent_duration} days</p>
            <p>Rented Till {car.return_date}</p>
          </div>
        ))}
      </div>
      {/* <Footer /> */}
    </div>
  )
}

export default LiveRented
